import React from "react";
import Header from "../components/Header";
import site1 from "./../media/site1.jpeg";

const Portfolio = () => {
  return (
    <div>
      <Header />
      <div className="content-portfolio">
        <div className="portfolio-carousel carousel slide">
          <div className="carousel-inner">
            <div class="carousel-item">
              <img src={site1} class="d-block w-100" alt="test" />
            </div>
            <div class="carousel-item">
              <img src={site1} class="d-block w-100" alt="test" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
